import React from "react";
import "./landing.css";

export default function Landing() {
  return (
    <div class="flex-container">
      <div class="flex-item-left">1</div>
      <div class="flex-item-center">2</div>
      <div class="flex-item-right">3</div>
    </div>
  );
}
